        let homeOddsClosing, drawOddsClosing, awayOddsClosing = pinnacleOdds.["0"].AsFloat(), pinnacleOdds.["1"].AsFloat(), pinnacleOdds.["2"].AsFloat()

        let extractStartingOdds (history:JsonValue) =
            let start = history.AsArray() |> Array.head
